import React from 'react';
import { Container} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';

const HomePage = () => {
  return (
    <div style={{ backgroundColor: '#3500ff', color: 'white', height: '100vh', padding: '2rem 1rem' }}>
      <Container fluid >
        <h2 className='tex'> clman</h2>
        <Container fluid >
          <div xs={12} md={5} className="">
            <div>
              <h1 className="display-1 fw-bold"
              //  style={{ textTransform: 'uppercase', fontSize:"8rem" ,lineHeight: '0.8', letterSpacing:"1.1,"}}
              style={{
              fontFamily: "Anton, sans-serif",
              textTransform: "uppercase",
              transform: "perspective(800px) rotateY(-30deg)",
              transformOrigin: "center left",
              lineHeight: 1.1,
              letterSpacing: "-0.02em",
              fontSize: "6rem",
              color: "#000",
              textShadow: "2px 2px 0 #fff",
              wordWrap: "break-word",
            }}>
               <span data-aos="fade-up">Studio</span><br />Mega
              </h1>
            </div>
          </div>
        </Container>
      <div
        style={{
          position: 'fixed',
          bottom: 80,
          left: 40,
          zIndex: 1000,
        }}
      >
         <div>
              <h1 className='' style={{ fontWeight: '900', lineHeight: '0.8', fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
            </div>
        <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
